import React, { useState, useEffect } from "react";
import axios from "axios";

const NotificationsComponent = () => {
  const [notifications, setNotifications] = useState([]);

  useEffect(() => {
    const fetchNotifications = async () => {
      try {
        const response = await axios.get(
          "https://dev-api.lovicogroup.com/api/v1/notifications "
        );
        // Kiểm tra kiểu dữ liệu của dữ liệu trả về
        console.log(typeof response.data);

        // Xử lý dữ liệu trả về theo cách phù hợp
        if (Array.isArray(response.data)) {
          // Nếu dữ liệu là mảng, cập nhật state bằng dữ liệu này
          setNotifications(response.data);
        } else {
          // Nếu không phải mảng, xử lý dữ liệu theo cách khác tùy thuộc vào cấu trúc của dữ liệu
          // Ví dụ: setNotifications(response.data.notifications);
        }
      } catch (error) {
        console.error("Error fetching notifications:", error);
      }
    };

    fetchNotifications();
  }, []);

  return (
    <div>
      <h2>Notifications</h2>
      <ul>
        {notifications.map((notification) => (
          <li key={notification.id}>
            <strong>{notification.payload.type}</strong>:{" "}
            {notification.payload.data.project.name}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default NotificationsComponent;
